                      </div>
                      <div style={{ paddingRight: "1rem" }}>
                        <p>N/A</p>
                      </div>
                    </div>
                    <div
                      style={{
                        display: "flex",
                        justifyContent: "space-between",
                        width: "8rem",
                      }}
                    >
                      <div>
                        <p style={{ fontWeight: "bold", color: "black" }}>
